function exportPdf(e,t){var n=new jsPDF;n.setFontSize(16),n.setFont("Arial");for(var a=e.length-1;a>=0;a--)n.text(50,25,e[a].description),n.addImage(e[a].image,"PNG",15,40),a+1<e.length-1&&n.addPage();n.save(t)}function exportArchive(e,t){for(var n=new JSZip,a=e.length-1;a>=0;a--)n.file("Step"+parseInt(a+1)+".png",e[a].image.replace(/data:(.*);base64,/g,""),{base64:!0});n.generateAsync({type:"blob"}).then(function(e){saveAs(e,t+".zip")})}function saveToGoogle(e,t){exportPdf(e,t),console.log("opa")}